import React from 'react';

function Footer() {
  return (
    <footer>
      <p>Connect with me:</p>
      <ul>
        <li><a href="https://github.com/kylaerod">GitHub</a></li>
        <li><a href="https://www.linkedin.com/in/kyla-rodriguez-a879ba16b/">LinkedIn</a></li>
        {/* Add links to other profiles */}
      </ul>
    </footer>
  );
}

export default Footer;
